import React, { useState } from 'react';
import axios from 'axios';

const MarksForm = () => {
  const [marks, setMarks] = useState({
    telugu: '',
    hindi: '',
    english: '',
    maths: '',
    science: '',
    social: '',
    studentId: ''
  });

  const handleChange = (e) => {
    setMarks({ ...marks, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const requestData = {
      telugu: parseInt(marks.telugu),
      hindi: parseInt(marks.hindi),
      english: parseInt(marks.english),
      maths: parseInt(marks.maths),
      science: parseInt(marks.science),
      social: parseInt(marks.social),
      studentId: {
        studentId: parseInt(marks.studentId)
      }
    };

    axios
      .post('http://localhost:8080/addMarks', requestData)
      .then((response) => {
        alert('Marks added successfully!');
        // Handle success response
      })
      .catch((error) => {
        alert('Error adding marks: ' + error.response.data);
        // Handle error response
      });
  };

  return (
    <div>
      <h2>Add Marks</h2>
      <form onSubmit={handleSubmit}>
        <label htmlFor="telugu">Telugu:</label>
        <input
          type="number"
          id="telugu"
          name="telugu"
          value={marks.telugu}
          onChange={handleChange}
          required
        /><br />

        <label htmlFor="hindi">Hindi:</label>
        <input
          type="number"
          id="hindi"
          name="hindi"
          value={marks.hindi}
          onChange={handleChange}
          required
        /><br />

        <label htmlFor="english">English:</label>
        <input
          type="number"
          id="english"
          name="english"
          value={marks.english}
          onChange={handleChange}
          required
        /><br />

        <label htmlFor="maths">Maths:</label>
        <input
          type="number"
          id="maths"
          name="maths"
          value={marks.maths}
          onChange={handleChange}
          required
        /><br />

        <label htmlFor="science">Science:</label>
        <input
          type="number"
          id="science"
          name="science"
          value={marks.science}
          onChange={handleChange}
          required
        /><br />

        <label htmlFor="social">Social:</label>
        <input
          type="number"
          id="social"
          name="social"
          value={marks.social}
          onChange={handleChange}
          required
        /><br />

        <label htmlFor="studentId">Student ID:</label>
        <input
          type="number"
          id="studentId"
          name="studentId"
          value={marks.studentId}
          onChange={handleChange}
          required
        /><br />

        <button type="submit">Add Marks</button>
      </form>
    </div>
  );
};

export default MarksForm;
